import React, { Component } from 'react';
import '../styles/about.scss';

export class About extends Component {
    render() {
        return (
            <div className="about-container">
            <div className="textarea">

            <p>I’m Gabrielle Kamph, a digital creative and front-end developer based in Stockholm, Sweden. <br/><br/>
            I have extensive experience within the field of digital marketing and a broad palette of skills such as content marketing, social media marketing, copywriting, project management, marketing automation and graphic design.I’m currently studying front-end development at Medieinstitutet to get cutting-edge knowledge in the field, graduating fall 2022. Don't hesitate to get in touch!</p>


            </div>
            </div>
        )
    }
}

export default About
